                    b.HasData(
                        new
                        {
                            Id = 1,
                            Content = "Gra wciąga, jest ogromna ilość zadań które gracz może wykonać i polecam ją sprawdzić. Jak komuś nie zadziała to szybki zwrot na Steamie i powrót za pół roku po patchach. Osobiście nie myślałem, że gra CDPR mnie tak wciągnie, ale mam już za sobą kilkanaście godzin a zrobiłem może 10% fabuły. Gra jest na wiele godzin, może do końca lockdownu ją przejdę :D",
                            GameId = 1,
                            GameplayScore = 7,
                            GraphicsScore = 4,
                            IsVerifiedOwner = false,
                            MusicScore = 8,
                            ReviewDate = new DateTime(2017, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 7,
                            UserId = 1
                        },
                        new
                        {
                            Id = 2,
                            Content = "Zanim może zacznę piać z zachwytu jaka to nie jest wspaniała gra, to myślę że warto wytłumaczyć dlaczego tak twierdzę. Przede wszystkim Cyberpunk, od momentu zapowiedzi w 2013, ani trochę mnie nie zainteresował. Nie śledziłem żadnych newsów na temat powstawania gry, nie oglądałem materiałów promocyjnych, ani nie oglądałem pierwszych pokazów gameplay. Grę kupiłem spontanicznie około dwa tygodnie przed premierę, nastawiając się na nią bardzo neutralnie, śmiejąc się przy tym z wyolbrzymionych oczekiwań i hype na temat tej gry. Przechodząc jednak do recenzji...",
                            GameId = 2,
                            GameplayScore = 5,
                            GraphicsScore = 6,
                            IsVerifiedOwner = false,
                            MusicScore = 6,
                            ReviewDate = new DateTime(2019, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 7,
                            UserId = 1
                        },
                        new
                        {
                            Id = 3,
                            Content = "Po 18 godzinach i kilku hotfixach muszę przyznać, że gra naprawdę jest coraz mniej zbugowana. Co do fabuły nie można się doczepić - wciąga i wzbudza emocje. Detale w tej grze stoją na najwyższym poziomie, przez co często zamiast skupić się na głównych questach, wolę czasami pochodzić po mieście i porobić coś bardziej oderwanego od ciągu fabuły. Genialna gra, słów brak by opisać wrażenia po tych kilkunastu godzinach gry. Kto się waha - niech się przemoże i kupi tę grę. To najlepiej wydane 200 zł na grę w moim życiu.",
                            GameId = 3,
                            GameplayScore = 8,
                            GraphicsScore = 7,
                            IsVerifiedOwner = false,
                            MusicScore = 7,
                            ReviewDate = new DateTime(2017, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 7,
                            UserId = 1
                        },
                        new
                        {
                            Id = 4,
                            Content = "Najprawdopodobniej jedna z najlepszych gier jakie powstały. Idealnie pokazuje brudny cyberpunkowy świat przez co wczucie się w cały ten klimat przychodzi z łatwością. Gra ma swoje problemy (liczne bugi, niektóre bardziej upierdliwe, drugie mniej) ale fabularnie - jest miazga. Mimo wszystko, warto poczekać na łatki które naprawią zdecydowaną większość bugów, ale nie zmienia to faktu że dostaliśmy coś, na co warto było czekać.",
                            GameId = 5,
                            GameplayScore = 8,
                            GraphicsScore = 9,
                            IsVerifiedOwner = false,
                            MusicScore = 5,
                            ReviewDate = new DateTime(2012, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 9,
                            UserId = 1
                        },
                        new
                        {
                            Id = 5,
                            Content = "Myślę że po 85 godzinach spędzonych w Night City, mogę wreszcie opisać jak czuję się z nowym tworem CD Projekt Red zwanym Cyberpunk 2077 bazowanym na papierowej grze fabularnej Cyberpunk 2020 stworzonej przez Mikea Pondsmitha. Po ośmiu latach w końcu doczekaliśmy się premiery gry na którą czekała bardzo dużą część graczy.",
                            GameId = 9,
                            GameplayScore = 9,
                            GraphicsScore = 10,
                            IsVerifiedOwner = false,
                            MusicScore = 9,
                            ReviewDate = new DateTime(2012, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 10,
                            UserId = 1
                        },
                        new
                        {
                            Id = 6,
                            Content = "Na początku myślałem ,że to żart jak gra jest zabugowana no i jak działa ale... no i właśnie jest to ale po przestawieniu myślenia i wgłębieniu się w fabułę ciężko było mi oderwać się od fabuły zarówno głównej jak i pobocznej. Jedna z lepiej napisanych historii. Czy gra mogłaby być lepiej zoptymalizowana - jasne, czy powinno być mnie bugów i glitch - jasne.",
                            GameId = 1,
                            GameplayScore = 5,
                            GraphicsScore = 7,
                            IsVerifiedOwner = false,
                            MusicScore = 4,
                            ReviewDate = new DateTime(2012, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 5,
                            UserId = 4
                        },
                        new
                        {
                            Id = 7,
                            Content = "Cyberpunk 2077. Jeżeli o mnie chodzi nie czułem jakiegoś mocnego hajpu na tę grę, nie czekałem na nią jakoś mocno, nawet nie planowałem jej kupić, a tym bardziej na premierę, bo nie jestem zwolennikiem kupowania gier zaraz po ich wyjściu, nie zapoznając się wcześniej z opiniami i recenzjami danej gry, jedyne co przyciągało moją uwagę to mocna kampania marketingowa i to że jest to gra polskiego studia CD projekt",
                            EditDate = new DateTime(2015, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            GameId = 2,
                            GameplayScore = 2,
                            GraphicsScore = 6,
                            IsVerifiedOwner = false,
                            ModeratorId = 1,
                            MusicScore = 3,
                            ReviewDate = new DateTime(2015, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            StoryScore = 6,
                            UserId = 4
