                        new
                        {
                            Id = 8,
                            Content = "Gra stawia nowe filary w gamedevie, jeśli chodzi o wertykalną warstwę fabularną, czy też oprawę audiowizualną. Ogrywanie jej na RayTracingu to istne wzrokowe wodotryski, ale nie każdy portfel jest na tyle gruby, żeby ograć to w stabilnych 60 klatkach. Natomiast gra ma potężne wady, których nie jestem w stanie wybaczyć developerom.",
                            EditDate = new DateTime(2012, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified),
