                        new
                        {
                            Id = 9,
                            Content = "Sądzę, że po przegraniu 160h+ mogę w końcu się wypowiedzieć. Gra ma błędy. Ale nie są to błędy niszczące rozrywkę, w najgorszym przypadku wystarczy wgrać save i po sprawie. tym bardziej, że sejwy wgrywają się w parenaście-paredziesiąt sekund. Pod względem otwartego świata nie to parę rzeczy kuleje",
                            GameId = 11,
