                            Id = 10,
                            Content = "Zdecydowanie polecam ale nie będę kłamać że gra na obecną chwile jest idealna, zarzuty w kwestii większych lub mniejszych błędów są jak najbardziej prawdziwe, ale to wciąż dobrze wykreowany i zbudowany świat z dobrą historią i świetnymi postaciami. Moja ocena 7/10. Przyszłe patche naprawią grę i będzie 10/10 :)",
                            GameId = 12,
