                            Id = 11,
                            Content = "Dla tych co się zastanawiają nad kupnem gry na szybko..., jeśli nie przeszkadzają Ci wizualne błędy, a Twój komputer daje przysłowiowo radę, to bierz i nie zastanawiaj się. Ja osobiście w trakcie 50h gry nie uświadczyłem żadnego crasha, poważnych błędów lub zbugowanych questów. A nawet jeśli by się zdarzyło to dla mnie żaden problem dopóki nie jest to częste.",
