                            Id = 13,
                            Content = "Obcowanie z tą grą to sinusoida oceny. Od początkowego zachwytu (grafiką i klimatem), przez rozczarowanie (odkrywanie elementów, które są strasznie słabe), realizm (wady nie przesłaniają zalet), aż po zakochanie (zżycie z postaciami i siła emocji przesłaniają biedę innych elementów)",
