                            Content = "Zdecydowanie się nie zawiodłem, klimaty i oprawa gry jest dokładnie taka jak sobie wyobrażałem. Rozgrywka bardzo przyjemna zdecydowanie nie będziecie się nudzić na mapie jest mnóstwo aktywności. Mapa jest świetnie zrobiona Night City wygląda ja faktyczna cyberpunkowa metropolia. Niestety na tą chwilę ma duże problemy z optymalizacją i jest sporo błędów ale wierzę że za jakiś czas twórcy to naprawią. Gra zdecydowanie warta polecenia.",
